import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';

function InterviewPage() {
  const [userResponse, setUserResponse] = useState('');
  const [feedback, setFeedback] = useState('');
  const location = useLocation();  // Access the name passed from NameInputPage

  // Visualize Interviewer's audio from a .wav file
  useEffect(() => {
    const visualizeInterviewerAudio = () => {
      const audioElement = document.getElementById('interviewer-audio');
      const audioContext = new (window.AudioContext || window.webkitAudioContext)();
      const audioSource = audioContext.createMediaElementSource(audioElement);
      const analyser = audioContext.createAnalyser();

      audioSource.connect(analyser);
      analyser.connect(audioContext.destination);

      const dataArray = new Uint8Array(analyser.frequencyBinCount);
      const visualElement = document.getElementById('interviewer-audio-visual');

      const visualize = () => {
        analyser.getByteFrequencyData(dataArray);
        const averageAmplitude = dataArray.reduce((a, b) => a + b, 0) / dataArray.length;
        const height = Math.min(averageAmplitude / 2, 100);
        visualElement.style.height = `${height}%`;
        requestAnimationFrame(visualize);
      };

      visualize();
    };

    visualizeInterviewerAudio();
  }, []);

  // Visualize Interviewee's audio input
  const startRecording = async () => {
    const audioContext = new (window.AudioContext || window.webkitAudioContext)();
    const analyser = audioContext.createAnalyser();
    const stream = await navigator.mediaDevices.getUserMedia({ audio: true });
    const source = audioContext.createMediaStreamSource(stream);
    source.connect(analyser);

    const dataArray = new Uint8Array(analyser.frequencyBinCount);
    const visualElement = document.getElementById('interviewee-audio-visual');

    const visualizeIntervieweeAudio = () => {
      analyser.getByteFrequencyData(dataArray);
      const averageAmplitude = dataArray.reduce((a, b) => a + b, 0) / dataArray.length;
      const height = Math.min(averageAmplitude / 2, 100);
      visualElement.style.height = `${height}%`;
      requestAnimationFrame(visualizeIntervieweeAudio);
    };

    visualizeIntervieweeAudio();
  };

  // Handle user response submission
  const handleSubmitResponse = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/interview', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          response: userResponse,
          name: location.state.name,  // Pass the name and response to the backend
        }),
      });

      if (!response.ok) {
        throw new Error('Failed to submit response');
      }

      const data = await response.json();  // Parse JSON response
      setFeedback(data.feedback);  // Set feedback received from the backend
    } catch (error) {
      console.error('Error submitting response:', error);
    }
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '20%' }}>
      <h2>Welcome, {location.state.name}. Let's start your interview!</h2>

      {/* Interviewer Section */}
      <div className="flex-1 flex flex-col items-center justify-center bg-gray-100">
        <h3>Interviewer</h3>
        <div id="interviewer-audio-visual" className="w-1/2 h-16 bg-green-500"></div>
        <audio id="interviewer-audio" src="/path-to-your-audio-file.wav" controls></audio>
      </div>

      {/* Interviewee Section */}
      <div className="flex-1 flex flex-col items-center justify-center bg-gray-200">
        <h3>Interviewee</h3>
        <div id="interviewee-audio-visual" className="w-1/2 h-16 bg-blue-500"></div>
        <button onClick={startRecording}>Start Recording</button>
      </div>

      {/* Text Response Section */}
      <textarea
        value={userResponse}
        onChange={(e) => setUserResponse(e.target.value)}
        placeholder="Type your response here"
        style={{ width: '80%', marginTop: '20px', height: '100px' }}
      />
      <br />
      <button onClick={handleSubmitResponse}>Submit Response</button>

      {/* Feedback Section */}
      {feedback && <p>Feedback: {feedback}</p>}
    </div>
  );
}

export default InterviewPage;
